	void LoadButtonHandler()
	{
		RtwMatrix mapIn = new RtwMatrix(100,100);
		try
		{
			mapIn = MISCLib.LoadMap(ProjectConstants.strMapFileLoad);
		}
		catch
		{
			GameObject.Find("GUIText").GetComponent<UILabel>().text = "Loading default map......";
			mapIn = LoadDefaultMap();
		}
			
		Vector3[] vertices =  Assets.Scripts.Common.MISCLib.MatrixToArray(Assets.Scripts.Common.MISCLib.FlipTopBottom(mapIn));
