        Mesh mesh = GameObject.Find("Plane").GetComponent<MeshFilter>().mesh;
        mesh.vertices = vertices;
		mesh.colors = Assets.Scripts.Common.MISCLib.ApplyDiffColorMap(vertices);
        mesh.RecalculateBounds();
        mesh.RecalculateNormals();		
	}
	
